const PicLarry = () => {
  return (
    <PicLarryContainer id="larry">
      {/* <Parallax y={[-40, 40]} tagOuter="figure"> */}
        <Image src={Larry} />
      {/* </Parallax> */}
    </PicLarryContainer>
  );
};

export default PicLarry;
